def glossary_header(week)
    return"<?xml version=\"1.0\" encoding=\"UTF-8\"?>
 <GLOSSARY>
  <INFO>
    <NAME>Week #{week} Glossary</NAME>
    <INTRO></INTRO>
    <INTROFORMAT>1</INTROFORMAT>
    <ALLOWDUPLICATEDENTRIES>0</ALLOWDUPLICATEDENTRIES>
    <DISPLAYFORMAT>dictionary</DISPLAYFORMAT>
    <SHOWSPECIAL>1</SHOWSPECIAL>
    <SHOWALPHABET>1</SHOWALPHABET>
    <SHOWALL>1</SHOWALL>
    <ALLOWCOMMENTS>1</ALLOWCOMMENTS>
    <USEDYNALINK>1</USEDYNALINK>
    <DEFAULTAPPROVAL>0</DEFAULTAPPROVAL>
    <GLOBALGLOSSARY>0</GLOBALGLOSSARY>
    <ENTBYPAGE>100</ENTBYPAGE>
    <ENTRIES>"
end

def essay_question_latex(title, question, answer)
  return "\\section*{#{title}}
  #{question}
  \\subsection*{Solution}
  #{answer}
  "
end

def glossary_footer()
    return "   </ENTRIES>
  </INFO>
</GLOSSARY>
"
end

def glossary_entry(title, text)
    return "<ENTRY>
        <CONCEPT>#{title}</CONCEPT>
        <DEFINITION>#{text}</DEFINITION>
        <FORMAT>1</FORMAT>
        <USEDYNALINK>0</USEDYNALINK>
        <CASESENSITIVE>0</CASESENSITIVE>
        <FULLMATCH>0</FULLMATCH>
        <TEACHERENTRY>1</TEACHERENTRY>
      </ENTRY>"
end

def xml_category(cat)
  return <<-ENDOFTHEXML
  <question type="category">
    <category>
      <text>#{cat}</text>
    </category>
    <info format="html">
      <text></text>
    </info>
    <idnumber></idnumber>
  </question>
  ENDOFTHEXML
end

def essay_question(title, question, answer)
  return <<-ENDOFTHEXML
    <question type="essay">
    <name>
      <text>#{title}</text>
    </name>
    <questiontext format="markdown">
      <text><![CDATA[#{question}]]></text>
    </questiontext>
    <generalfeedback format="markdown">
      <text><![CDATA[#{answer}]]></text>
    </generalfeedback>
    <defaultgrade>1.0000000</defaultgrade>
    <penalty>0.0000000</penalty>
    <hidden>0</hidden>
    <idnumber></idnumber>
    <responseformat>editor</responseformat>
    <responserequired>1</responserequired>
    <responsefieldlines>25</responsefieldlines>
    <minwordlimit></minwordlimit>
    <maxwordlimit></maxwordlimit>
    <attachments>0</attachments>
    <attachmentsrequired>0</attachmentsrequired>
    <maxbytes>0</maxbytes>
    <filetypeslist></filetypeslist>
    <graderinfo format="html">
      <text></text>
    </graderinfo>
    <responsetemplate format="html">
      <text></text>
    </responsetemplate>
  </question>
  ENDOFTHEXML
end

