    <filenamesexplain></filenamesexplain>
    <displayfeedback>1</displayfeedback>
    <giveupallowed>0</giveupallowed>
    <prototypeextra></prototypeextra>
    <testcases>
ENDOFTHEXML
end

def lox_testcase(input, output)
  return <<-ENDOFTHEXML
      <testcase testtype="0" useasexample="0" hiderestiffail="0" mark="1.0000000" >
      <testcode>
                <text>#{input}</text>
      </testcode>
      <stdin>
                <text></text>
      </stdin>
      <expected>
                <text><![CDATA[#{output}]]></text>
      </expected>
      <extra>
                <text></text>
      </extra>
      <display>
                <text>SHOW</text>
      </display>
    </testcase>
    <file name="lox.jar" path="/" encoding="base64"></file>
ENDOFTHEXML
end

def lox_question_bottom()
    return "</testcases>
  </question>"
end

